import React, { useState } from "react";
import axios from "axios";
import { Navigate } from "react-router-dom";

function Login() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [location, setLocation] = useState("");
  const [otp, setOtp] = useState("");
  const [message, setMessage] = useState("");
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const express = require("express");
const mongoose = require("mongoose");
const dotenv = require("dotenv");
const cors = require("cors");
const { generateOTP, sendOTP } = require("./utils/otp");

dotenv.config();

const app = express();
app.use(express.json());
app.use(cors());

// Connect to MongoDB
mongoose.connect(process.env.MONGODB_URI, {
  useNewUrlParser: true,
  useUnifiedTopology: true,
});

// Define a Mongoose schema for user details
const UserSchema = new mongoose.Schema({
  email: { type: String, required: true },
  // Add other fields you want to store
});

const User = mongoose.model("User", UserSchema);

// Routes
app.post("/api/send-otp", async (req, res) => {
  const { email } = req.body;
  const otp = generateOTP(); // Generate OTP
  try {
    await sendOTP(email, otp); // Send OTP via email
    res.status(200).json({ success: true, otp });
  } catch (error) {
    console.error("Error sending OTP:", error);
    res.status(500).json({ success: false, error: "Failed to send OTP" });
  }
});

// Login route to store user details
app.post("/api/login", async (req, res) => {
  const { email, /* other details */ } = req.body;
  try {
    // Check if the user exists
    let user = await User.findOne({ email });
    if (!user) {
      // If the user doesn't exist, create a new user
      user = new User({ email, /* other details */ });
      await user.save();
    }
    res.status(200).json({ success: true, message: "User details saved successfully" });
  } catch (error) {
    console.error("Error saving user details:", error);
    res.status(500).json({ success: false, error: "Failed to save user details" });
  }
});

// Start server
const PORT = process.env.PORT || 5000;
app.listen(PORT, () => console.log(`Server running on port ${PORT}`));


  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  if (isLoggedIn) {
    return <Navigate to="/" />;
  }

  return (
    <div className="flex justify-center items-center h-screen">
      <div className="bg-white p-8 rounded shadow-md w-full max-w-sm">
        <div className="flex items-center pl-6  justify-start font-bold  text-black ">
          <img
            src="agritech.jpg"
            alt="Agritech Icon"
            className="mr-2 rounded-full"
            style={{ height: "40px", width: "40px" }}
          />
          <h3 className="text-xl  text-black font-mono mb-2">
            Agritech Insight
          </h3>
        </div>
        <p className="text-md pl-[80px] text-green-600 font-mono mb-2">
          {" "}
          Please login ....{" "}
        </p>
        <div className="mb-4">
          <label htmlFor="name" className="block text-gray-700 mb-1">
            Name:
          </label>
          <input
            type="text"
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            placeholder="Enter your name"
            className="w-full border border-gray-300 rounded px-3 py-2 focus:outline-none focus:border-blue-500"
          />
        </div>
        <div className="mb-4">
          <label htmlFor="email" className="block text-gray-700 mb-1">
            Email:
          </label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="Enter your email"
            className="w-full border border-gray-300 rounded px-3 py-2 focus:outline-none focus:border-blue-500"
          />
        </div>
        <div className="mb-4">
          <label htmlFor="location" className="block text-gray-700 mb-1">
            Location:
          </label>
          <input
            type="text"
            id="location"
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            placeholder="Enter your location"
            className="w-full border border-gray-300 rounded px-3 py-2 focus:outline-none focus:border-blue-500"
          />
        </div>
        <div className="mb-4">
          <label htmlFor="otp" className="block text-gray-700 mb-1">
            OTP:
          </label>
          <div className="flex">
            <input
              type="text"
              id="otp"
              value={otp}
              onChange={(e) => setOtp(e.target.value)}
              placeholder="Enter OTP"
              className="flex-1 border border-gray-300 rounded-l px-3 py-2 focus:outline-none focus:border-blue-500"
            />
            <button
              onClick={handleSendOTP}
              className="bg-blue-500 text-white px-4 py-2 rounded-r"
            >
              Send OTP
            </button>
          </div>
        </div>
        <div className="mb-4">
          <button
            onClick={handleLogin}
            className="bg-green-500 text-white px-4 py-2 rounded w-full"
          >
            Login
          </button>
        </div>
        {message && <p className="text-red-500">{message}</p>}
      </div>
    </div>
  );
}

export default Login;
